import React from 'react'
import './Card.css';
import Todo from './Todo';
import Data from './Data.json';

function Card() {
  
  return (
    <div className="container">
      
          <Todo title={Data[0].title} desc={Data[0].desc}/>
  </div>
  )
}

export default Card
